<?php
    session_start();
    include('sqlconnect.php'); // Make sure this path is correct

    date_default_timezone_set('Asia/Manila');
    $today = date('Y-m-d');

    // --- FETCH RECENT ATTENDANCE EVENTS FOR INITIAL PAGE LOAD ---
    $attendance_events = [];
    // The query remains the same as before
    $query = "
        SELECT CONCAT(p.FirstName, ' ', p.LastName) AS FullName, EventTime, EventType
        FROM (
            SELECT att.AccountID, att.TimeIn AS EventTime, 'Time In' AS EventType
            FROM tblattendance att
            WHERE att.AttendanceDate = ?
            UNION ALL
            SELECT att.AccountID, att.TimeOut AS EventTime, 'Time Out' AS EventType
            FROM tblattendance att
            WHERE att.AttendanceDate = ? AND att.TimeOut IS NOT NULL
        ) AS events
        JOIN tblaccounts acc ON events.AccountID = acc.AccountID
        JOIN tblemployees emp ON acc.EmployeeID = emp.EmployeeID
        JOIN tblpersonalinfo p ON emp.PersonalID = p.PersonalID
        ORDER BY EventTime DESC
        LIMIT 10;
    ";
    $stmt_fetch = $conn->prepare($query);
    if ($stmt_fetch) {
        $stmt_fetch->bind_param("ss", $today, $today);
        $stmt_fetch->execute();
        $result_fetch = $stmt_fetch->get_result();
        while ($row = $result_fetch->fetch_assoc()) {
            $attendance_events[] = $row;
        }
        $stmt_fetch->close();
    }
?>

